// src/components/modals/UploadModal.js
import React, { useState } from 'react';
import documentService from '../../services/documentService';
import './UploadModal.css';

const UploadModal = ({ onClose }) => {
  const [activeTab, setActiveTab] = useState('upload'); // 'upload' or 'folder'
  const [file, setFile] = useState(null);
  const [folderName, setFolderName] = useState('');
  const [title, setTitle] = useState('');
  const [isPublic, setIsPublic] = useState(false);
  const [loading, setLoading] = useState(false);

  const handleFileSelect = (e) => {
    const selectedFile = e.target.files[0];
    setFile(selectedFile);
    if (selectedFile && !title) {
      setTitle(selectedFile.name);
    }
  };

  const handleUpload = async (e) => {
    e.preventDefault();
    if (!file) return;

    setLoading(true);
    try {
      const formData = new FormData();
      formData.append('file', file);
      formData.append('title', title);
      formData.append('isPublic', isPublic);

      await documentService.uploadDocument(formData);
      onClose();
    } catch (error) {
      console.error('Upload failed:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleCreateFolder = async (e) => {
    e.preventDefault();
    if (!folderName.trim()) return;

    setLoading(true);
    try {
      await documentService.createFolder({ name: folderName });
      onClose();
    } catch (error) {
      console.error('Folder creation failed:', error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="modal-overlay" onClick={onClose}>
      <div className="modal-content" onClick={(e) => e.stopPropagation()}>
        <div className="modal-header">
          <h2>Create New</h2>
          <button className="close-button" onClick={onClose}>×</button>
        </div>

        <div className="modal-tabs">
          <button 
            className={`tab ${activeTab === 'upload' ? 'active' : ''}`}
            onClick={() => setActiveTab('upload')}
          >
            Upload File
          </button>
          <button 
            className={`tab ${activeTab === 'folder' ? 'active' : ''}`}
            onClick={() => setActiveTab('folder')}
          >
            Create Folder
          </button>
        </div>

        <div className="modal-body">
          {activeTab === 'upload' ? (
            <form onSubmit={handleUpload}>
              <div className="form-group">
                <label>Select File</label>
                <input
                  type="file"
                  onChange={handleFileSelect}
                  required
                />
              </div>

              <div className="form-group">
                <label>Title</label>
                <input
                  type="text"
                  value={title}
                  onChange={(e) => setTitle(e.target.value)}
                  required
                />
              </div>

              <div className="form-group">
                <label>
                  <input
                    type="checkbox"
                    checked={isPublic}
                    onChange={(e) => setIsPublic(e.target.checked)}
                  />
                  Make public
                </label>
              </div>

              <button type="submit" disabled={loading || !file}>
                {loading ? 'Uploading...' : 'Upload'}
              </button>
            </form>
          ) : (
            <form onSubmit={handleCreateFolder}>
              <div className="form-group">
                <label>Folder Name</label>
                <input
                  type="text"
                  value={folderName}
                  onChange={(e) => setFolderName(e.target.value)}
                  required
                />
              </div>

              <button type="submit" disabled={loading || !folderName.trim()}>
                {loading ? 'Creating...' : 'Create Folder'}
              </button>
            </form>
          )}
        </div>
      </div>
    </div>
  );
};

export default UploadModal;
